import { React, useEffect, useState } from "react";
import axios from "axios";

const Kategorije = () => {
  const [data, setData] = useState({ hits: [] });

  useEffect(async () => {
    const result = await axios("http://localhost:5000/kategorije/");

    setData(result.data);
  });

  return (
    <ul>
      {data.hits.map((item) => (
        <li key={item.naziv}>
          <a href={item.moderator}>{item.moderator}</a>
        </li>
      ))}
    </ul>
